地方了十多年快乐的女生看看奋斗史那份快乐你&nbsp;</p>'),(12,'11','1','2019-11-09 08:33:12.021515','<p><br/></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://localhost:8083/static/ueditor/dialogs/attachment/fileTypeImages/icon_jpg.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/media/files/webchat_20191109083307_744.jpg\" title=\"webchat.jpg\">webchat.jpg</a></p><p><br/></p>'),(13,'h','d','2019-11-11 14:57:25.519829','<p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://10.141.165.215:8083/static/ueditor/dialogs/attachment/fileTypeImages/icon_txt.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/media/files/出差_20191111145710_492.xlsx\" title=\"出差.xlsx\">出差.xlsx</a></p><p style=\"line-height: 16px;\"><img style=\"vertical-align: middle; margin-right: 2px;\" src=\"http://10.141.165.215:8083/static/ueditor/dialogs/attachment/fileTypeImages/icon_pdf.gif\"/><a style=\"font-size:12px; color:#0066cc;\" href=\"/media/files/成都廠區住宿管理規約之2號苑_20191111145710_440.pdf\" title=\"成都廠區住宿管理規約之2號苑.pdf\">成都廠區住宿管理規約之2號苑.pdf</a></p><p>dhnkvl;dncjv bdcl;dsfc kjb<br/></p>'),(14,'广州文化游玩','郭志航','2019-11-12 08:22:32.198812','<h3 style=\"margin: 0px 0px 8px; padding: 0px; font-size: 18px; color: rgb(51, 51, 51);\">黄埔军校旧址-广州塔-陈家祠-西关古老大屋-珠江夜游天字码头</h3><p><span class=\"_day iconfont icon-icon_scenic_\" style=\"font-size: 16px; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(153, 153, 153); padding: 3px 0px; position: absolute; left: -8px; top: 0px; font-family: iconfont !important;\"></span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">10:00</p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">黄埔军校旧址</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">【游览黄埔军校旧址】景仰先烈，看民国英华（每逢周一黄埔军校闭馆，改为游览黄埔古港）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">11:00</p><p><span class=\"_day iconfont icon-icon_experience_\" style=\"font-size: 16px; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(153, 153, 153); padding: 3px 0px; position: absolute; left: -8px; top: 0px; font-family: iconfont !important;\"></span></p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">【乘有轨电车】</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">乘有轨电车，路过猎德桥，从万胜围的古旧驶入广州塔下珠江两岸的新潮。远光广州塔</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">11:30</p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">广州塔</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">【打卡广州塔】有轨电车的尽头，便是城市地标——小蛮腰。美拍广州塔，看对岸繁华的广州中轴线，准备前往下一站。</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">12:30</p><p><span class=\"_day iconfont icon-icon_experience_\" style=\"font-size: 16px; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(153, 153, 153); padding: 3px 0px; position: absolute; left: -8px; top: 0px; font-family: iconfont !important;\"></span></p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">【美食体验第一站】&nbsp;推荐AA</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">第一站美食体验地位于老广州西关。您可以放心闲逛，并适时解决午餐；如果您有需要，也可以让G.O帮您推荐地道的当地美食。\r\n（因各人口味不同，我们建议大家自理或AA餐食哦。）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">14:00</p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">陈家祠</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">【陈家祠】作为老广州建筑的扛鼎之作，雕梁画栋，思旧日年华。 （陈家祠景区需要刷身份证进入，请旅客大大出发前务必记得带身份证，重要的事情说三遍！带上身份证！带上身份证！带上身份证！）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">15:00</p><p><span class=\"_day iconfont icon-icon_experience_\" style=\"font-size: 16px; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(153, 153, 153); padding: 3px 0px; position: absolute; left: -8px; top: 0px; font-family: iconfont !important;\"></span></p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">【荔湾湖公园——偶遇一场粤剧】</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">广州人的茶余饭后，踢毽子，唱歌班，与粤剧票友来一次不期而遇；</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">15:30</p><p><span class=\"_day iconfont icon-icon_experience_\" style=\"font-size: 16px; -webkit-font-smoothing: antialiased; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial; color: rgb(153, 153, 153); padding: 3px 0px; position: absolute; left: -8px; top: 0px; font-family: iconfont !important;\"></span></p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">【西关美食体验】&nbsp;&nbsp;&nbsp;推荐AA</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">即将消失的西关风景，多个百年字号一字排开，是解读广府往事的钥匙。 同时这里也是美食体验第二站，带你在西关吃出花样。由于美食喜好各有不同，且部分美食存在分食情况。我们强烈推荐AA制。（美食费用预计40-50元/人）</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\">16:30</p><h4 style=\"margin: 0px 0px 8px; padding: 0px; color: rgb(51, 51, 51); line-height: 22px;\">沙面街道</h4><p class=\"desc\" style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; white-space: pre-wrap;\">【游览沙面】作为曾经的十三行的门面，这里保有着旧时租界的摸样。大多数人，都因为这边颜色各异的洋房，欣喜不已。在这里，</p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; overflow-wrap: break-word; font-size: 12px; color: rgb(153, 153, 153); line-height: 16px;\"><br/></p>'),(15,'音乐','luke','2019-11-16 09:31:28.986041','<p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">文 | 搜狐科技 马文玥</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">11月15日，2019联想创新科技大会个人智能及终端主题上，联想现场展示了全球首款折叠屏笔记本电脑ThinkPad X1和motorola razr折叠屏手机以及全球首款5G PC等新品。并官宣正式成为中国国家女子排球队主赞助商、官方合作伙伴。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">联想ThinkPad X1面向高端商务市场，这款产品展开可以作为平板电脑使用，折叠后仅有笔记本大小。在实际使用时，折叠后一块屏幕即可化身键盘。据悉，这款产品采用韩国LG公司合作生产的2K OLED可折叠显示屏，打开后屏幕大小为13.3英寸，屏幕比例为4:3.。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><img src=\"http://localhost:8083/media/images/1_20191116093111_490.jpg\" title=\"\" alt=\"1.jpg\" width=\"567\" height=\"396\" style=\"white-space: normal; width: 567px; height: 396px;\"/></p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">联想旗下首款折叠屏手机Motorola RAZR采用上下折叠，与当年的“刀锋”Motorola RAZR翻盖机十分相似联想董事长兼CEO杨元庆称其为“一代经典、智能回归”。（图片详情见搜狐科技此前报道：<a href=\"https://www.sohu.com/a/353923317_115565?spm=smpc.content.content.2.1573867843597VcD4sgC\" target=\"_blank\" data-spm-data=\"2\" style=\"background-color: transparent; border: 0px; margin: 0px; padding: 0px; color: rgb(0, 102, 204);\">联想摩托罗拉RAZR折叠屏手机发布 外形似经典翻盖机</a>）</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">摩托罗拉RAZR搭载骁龙710处理器，6GB内存，128GB内部存储，6.2英寸可折叠pOLED显示屏（2142 x 876），2.7英寸快速查看显示屏（800 x 600），16MP前置摄像头，f/1.7，带夜视模式。5MP内置摄像头，支持USB-C、eSIM卡，搭载Android 9 Pie系统，还有指纹识别传感器。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">值得注意的是，摩托罗拉RAZR没有物理卡槽，所以不支持SIM卡；由于采用上下折叠的方式，摩托罗拉RAZR屏幕面积与普通智能手机相当。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">此外，联想还推出全球首款5G电脑。据悉，这款全球5G电脑包括三项核心技术：双制式全频段，频率自适应天线，双路闪充。不过这款产品还没有公布具体上市时间。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">现场，杨元庆向大家介绍了联想的个人智能产品战略：联想将围绕着四个关键要素，即智能设备（smart Device），设备协同引擎（cross-device Engine），智能家庭服务器（home Edge server），以及应用服务（app/service Ecosystem），来打造以人为中心的个人智能体验（People-oriented smart experience）。杨元庆将其简称为d-e-e-e-P。</p><p style=\"border: 0px; margin-top: 0.63em; margin-bottom: 1.8em; padding: 0px; counter-reset: list-1 0 list-2 0 list-3 0 list-4 0 list-5 0 list-6 0 list-7 0 list-8 0 list-9 0; color: rgb(25, 25, 25); font-family: &quot;PingFang SC&quot;, Arial, 微软雅黑, 宋体, simsun, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\">杨元庆表示联想首先将继续专注于让PC、平板和手机等核心智能设备更智能，同时不断推出多样化的新型智能设备。接下来，联想要通过拥有边缘计算力的智能服务器和设备协同引擎，让个人能够轻松在不同智能设备间分享数据，体验应用与服务。</p><p><br/></p>'),(16,'B225','test2','2019-11-19 16:33:33.868279','<p style=\"margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 22px;\"><span class=\"bjh-p\">&nbsp;&nbsp;&nbsp;&nbsp;新浪财经11月18日消息，金山办公今日上交所鸣锣上市，公司实际控制人，同时也是金山集团董事长、小米集团董事长兼首席执行官雷军在开盘仪式上谈到，金山办公1999年计划筹备上市时，葛珂就是董秘，没想到一等20年，现在葛珂已经成了金山办公CEO，他应该是A股市场上最励志的董秘。台下哄然一笑。葛珂目前为金山办公董事长兼首席执行官。</span></p><p style=\"margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(51, 51, 51); text-align: justify; font-family: arial; white-space: normal; background-color: rgb(255, 255, 255); margin-top: 22px;\"><span class=\"bjh-p\">&nbsp;&nbsp;&nbsp;&nbsp;雷军表示这是31年的梦想成真。“在科创板上市，首先是坚持的胜利，从1988年，金山WPS走了31年，这是一个坚持梦想并最终取得胜利的励志故事。其次，这是坚持“技术立业”的胜利。</span></p><p style=\"margin-top: 22px;\"><img src=\"/media/images/屏幕快照 2019-10-08 下午5.36.43_20191119163307_112.png\" title=\"\" alt=\"屏幕快照 2019-10-08 下午5.36.43.png\"/></p><p style=\"margin-top: 22px;\"><span style=\"color: rgb(51, 51, 51); font-family: arial; text-align: justify; background-color: rgb(255, 255, 255);\">&nbsp;&nbsp;&nbsp;&nbsp;资料显示，金山办公主要从事 WPS Office 办公软件 产品及服务的设计研发及销售推广。 公司产品主要包括 WPS Office 办公软件和金山词霸等，可在 Windows、Linux、 MacOS、Android、iOS 等众多主流操作平台上应用；公司服务主要包括基于公 司产品及相关文档的增值服务以及互联网广告推广服务，为客户提供一站式、多平台应用解决方案。</span></p>');
